import React, { Component } from "react";
import { gql } from "apollo-boost";

const getProductQuery = gql`
    products {
        id
        model_name
        model_color
        model_category
  }
`;

class ProductList extends Component {
  render() {
    return (
      <div>
        <ul>
          <li>Product</li>
        </ul>
      </div>
    );
  }
}

export default ProductList;
